import React from 'react';
import {
    Container,
    Card,
    Button,
    Row,
    Col
  } from 'react-bootstrap';

  const Login = () => {
    return(
        <>
        <Container>
            <Card></Card>
            <Button></Button>
            <Row></Row>
        </Container>
        </>
    )
  }

export default Login;
